import React from "react";
import styles from "./Skills.module.css"
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub } from '@fortawesome/free-brands-svg-icons';

const Skills = () => {
    return (
        <div className={styles.display__skills}>
            <h1 className={styles.display__title}>Skills</h1>
            <div className={styles.display__skillTitles}>
                <button className={styles.tech__skills}>Technical Skills</button>
                <button className={styles.soft__skills}>Soft Skills</button>
            </div>
            <div className={styles.display__screen}>
                <div>
                    <FontAwesomeIcon icon={faGithub}/>
                </div>
            </div>
        </div>
    );
} 

export default Skills;
